'use strict';

const {NativeModules} = require('react-native');

const {Assert} = NativeModules;

const Asserts = {
  assertEquals: function(expected, actual, msg) {
    if (expected !== actual) {
      Assert.fail(
        msg ||
          'Expected: ' +
            expected +
            ', received: ' +
            actual +
            '\n' +
            'at ' +
            new Error().stack,
      );
    } else {
      Assert.success();
    }
  },
  assertTrue: function(expr, msg) {
    Asserts.assertEquals(true, expr, msg);
  },
};

module.exports = Asserts;
